ia accused David of having an affair. </ts><ts n="e" id="Seg_1312" s="T69" e="T70">((0,6s)) </ts><ts n="e" id="Seg_1314" s="T70" e="T71">Tell us about that. </ts></ts><ts n="sc" id="Seg_1315" s="T84" e="T87"><ts n="e" id="Seg_1317" s="T84" e="T85">Hm˙ </ts><ts n="e" id="Seg_1319" s="T85" e="T86">It wasn't true, </ts><ts n="e" id="Seg_1321" s="T86" e="T87">the story? </ts></ts><ts n="sc" id="Seg_1322" s="T88" e="T89"><ts n="e" id="Seg_1324" s="T88" e="T89">But nonetheless, it was/ it was in the papers, it was printed and/ and it affected your relationship. </ts></ts><ts n="sc" id="Seg_1325" s="T101" e="T102"><ts n="e" id="Seg_1327" s="T101" e="T102">You whacked him? </ts></ts><ts n="sc" id="Seg_1328" s="T105" e="T106"><ts n="e" id="Seg_1330" s="T105" e="T106">Three times? </ts></ts><ts n="sc" id="Seg_1331" s="T107" e="T109"><ts n="e" id="Seg_1333" s="T107" e="T108">Yeah? </ts><ts n="e" id="Seg_1335" s="T108" e="T109">Hurt you? </ts></ts><ts n="sc" id="Seg_1336" s="T110" e="T113"><ts n="e" id="Seg_1338" s="T110" e="T111">Yeah. </ts><ts n="e" id="Seg_1340" s="T111" e="T112">In fact, hurting so much that/ that's you/ you/ you were very depressed, weren't you? </ts><ts n="e" id="Seg_1342" s="T112" e="T113">You… </ts></ts><ts n="sc" id="Seg_1343" s="T114" e="T115"><ts n="e" id="Seg_1345" s="T114" e="T115">((0,6s)) Well, how depressed were you, what did you do</ts></ts><ts n="sc" id="Seg_1346" s="T116" e="T117"><ts n="e" id="Seg_1348" s="T116" e="T117">((unv.)) </ts></ts><ts n="sc" id="Seg_1349" s="T135" e="T136"><ts n="e" id="Seg_1351" s="T135" e="T136">You were looking out the window thinking… </ts></ts><ts n="sc" id="Seg_1352" s="T137" e="T138"><ts n="e" id="Seg_1354" s="T137" e="T138">(so)</ts></ts><ts n="sc" id="Seg_1355" s="T140" e="T141"><ts n="e" id="Seg_1357" s="T140" e="T141">(to jump) </ts></ts><ts n="sc" id="Seg_1358" s="T145" e="T153"><ts n="e" id="Seg_1360" s="T145" e="T146">((laughing)) </ts><ts n="e" id="Seg_1362" s="T146" e="T147">((laughing)) </ts><ts n="